import './App.css';
import { TodoList } from '../TodoList/TodoList';
import { AddTodo } from '../AddTodo/AddTodo';

const todo = {
  description : 'todo'
}

const todoList = [todo,todo,todo]

function App() {

  return (
    <div className="App">

      <div>
        <AddTodo />
      </div>
      <div>
        <TodoList todoList={todoList} />
      </div>

    </div>
  );
}

export default App;
